// Extends ProfileList //
export default function ProfileListItem({style, data, setFocused}) {

  const handleFocus = (data) => {
    if (['did', 'las'].includes(data.type)) return

    setFocused([data.data, data.type])
  }

  return (
    <div style   = {style.listItemContainer}
         onClick = {() => handleFocus(data[0])}
        //  onClick = {(e) => {handleFocus(e, data[0]['type'])}}
         >

      <div style={style.listItemDataMain}>{data[0]['data']}</div>
      
      {
        data.slice(1).map((item, i) => (
          <div key   = {`LData${i}`} 
               style = {style.listItemDataOther}>

            {item['data']}
          </div>
        ))
      }
    </div>
  )
}
